const getDataFromApi = () => {
    return fetch("https://randomuser.me/api/?results=10")
        .then((response) => response.json())
        .then((data) => {
            return data.results.map((user) => {
                return {
                    id: user.login.id,
                    username: user.login.username,
                };
            });
        });
};

export default getDataFromApi;
